import React from 'react'
import { Box, Typography } from '@mui/material'

const SidebarCard = () => {
    return (
        <Box sx={{
            width: '150px',
            height: '150px',
            textAlign: 'center',
            backgroundColor: '#9b59b6',
            color: 'white',
            margin: '20px',
            justifyContent: 'center'
        }}>
            <Typography>Weight Training</Typography>
        </Box>
    )
}

export default SidebarCard
